(1, 'HTML''ye Giriş', 'html-ye-giris', 1, 'Ücretsiz Kod Kampı''nın ilk kodlama sorununa hoş geldiniz.\r\n\r\nKodu, bu web sayfasına yerleştirdiğimiz metin düzenleyicisinde düzenleyebilirsiniz.\r\n\r\nMetin düzenleyicisinde \r\n<xmp><h1> Merhaba </h1></xmp> yazan kodu görüyor musunuz? Bu bir HTML öğesi.\r\n\r\nÇoğu HTML öğesinin bir açılış etiketi ve bir kapatma etiketi vardır.\r\n\r\nAçılış etiketleri şuna benzer:\r\n\r\n<xmp><h1></xmp>\r\n\r\nKapanış etiketleri şuna benzer:\r\n\r\n<xmp></h1></xmp>\r\n\r\nAçılış etiketleri ile kapatma etiketleri arasındaki tek fark, kapanış etiketlerinin açılış köşeli ayraçlarından sonra eğik çizgiye sahip olmalarıdır.\r\n\r\nHer meydan okumada, "Testleri çalıştır" düğmesini tıklayarak istediğiniz zaman çalıştırabilirsiniz. Tüm testleri geçtikten sonra bir sonraki zorluğa ilerleyebilirsiniz.\r\n\r\nBu sorunun testini geçmek için, h1 öğesinin metnini "Merhaba" yerine "Merhaba Dünya" olarak değiştirin. Ardından "Testleri çalıştır" düğmesini tıklayın.', '<h1>Merhaba</h1>'),
(2, 'Başlıklar: ''h2'' Ögesi', 'basliklar-h2-ogesi', 1, 'Önümüzdeki birkaç zorlukla birlikte, buna benzer bir HTML5 uygulaması oluşturacağız:\r\n\r\nGirdiğiniz h2 öğesi web sitesinde bir h2 öğesi oluşturacaktır.\r\n\r\nBu öğe, tarayıcıya web sitenizin yapısını bildirir. H1 elemanları genel olarak ana başlıklar için kullanılırken, h2 elemanları genel olarak alt başlıklar için kullanılır. Farklı ve yeni bölümleri belirtmek için h3, h4, h5 ve h6 öğeleri de vardır.', '<h1>Merhaba Dünya</h1>');
